import numpy as np
import matplotlib.pyplot as plt
import time
import scipy.constants as const
def read_xyz_trj(file_name):
    start = time.time()
    xyz_file = open(file_name, 'r')

    frame = 0
    xyz = {}
    READING=True
    while READING:
        try:
            nparts = int(xyz_file.readline())
            xyz_file.readline()
            xyz[frame] = np.zeros([nparts, 3])
            for k in range(0, nparts):
                line = xyz_file.readline()
                line = line.split()
                xyz[frame][k, 0] = line[1]
                xyz[frame][k, 1] = line[2]
                xyz[frame][k, 2] = line[3]
            frame += 1
            print(f"reading {file_name.split('/')[-1]} {time.time()-start}", end='\r', flush=True)
        except:
            print(f"Done reading {file_name.split('/')[-1]} {time.time()-start}")
            READING=False

    return xyz

