def diffusionEinstein(traj, tmax, sample_freq=10):
    start = time.time()
    print(f'Calculating MSD for {tmax} steps')
    positions = np.array(list(traj.values()))
    MSD = []
    x_0 = positions[0]
    for t in range(tmax):
        if t % sample_freq == 0:
            x_t = positions[t]
            MSD.append(np.sum(np.linalg.norm(x_t - x_0, axis=1)**2))
            print(f'Calculated MSD for {t} steps{time.time()-start}', end='\r', flush=True)
    end = time.time()
    print(f'MSD Calculation Complete in:{end-start}')
    return np.array(MSD)


