def calc_diffusion_coefficient(MSD, npart):
    time = np.array([i for i in range(1, len(MSD))])
    log_time = np.log10(time)
    log_MSD = np.log10(MSD[1:]/(npart*len(MSD)/6))
    start_index = 100
    end_index = 80000
    slope = np.polyfit(log_time[start_index:end_index], log_MSD[start_index:end_index], 1)
    D = 10**slope[1]
    return D

