def plot_msd_side(MSDS, side_lengths):
    plt.figure(figsize=(7, 5))
    molecules = np.array([362, 750, 1500])
    plt.plot(side_lengths, MSDS, 'o')
    plt.plot(side_lengths, MSDS, '--')
