def correctionYehHammer(side_lengths, visc, temp):
    return 10**5*(const.k*temp*2.83729)/(6*np.pi*visc*side_lengths*10**-10)

def calculate_diffusion_coefficient(T, visc):
    sigma = 3.72 * 10**-10
    return 10**5*(const.k*T)/(6*np.pi*visc*sigma)

